import React from 'react'
import '../css/Home.css'

class RPE extends React.Component {

    render() {
        return this.chart()
    }

    chart() {
        // create array of 9 for y axis
        let yAxis = new Array(9);

        // create array of 13 for each index of y axis
        for(let i = 0; i < yAxis.length; i++) {
            yAxis[i] = new Array(13);
        }

        // @ sign for [0][0]
        yAxis[0][0] = "@"

        // populate rpe
        let rpe = 10.0;
        for(let i = 1; i < yAxis.length; i++) {
            yAxis[i][0] = rpe;
            rpe = rpe -.5
        }

        // populate rep count
        let reps = 1;
        for(let i = 1; i < yAxis[0].length; i++) {
            yAxis[0][i] = reps;
            reps = reps + 1;
        }

        // populate first row
        yAxis[1][1] = 100 + "%"

        return <div>
            {yAxis[1][1]}
        </div>
    }

}

export default RPE
